import React from 'react'
// import '../Product.css'
import Foods from './Foods.js';
// import data from './components/Product/functions/data'
import dataa from './components/Product/functions/data-2.js'

import Product from './Product.js';

export default function Main(props) {
    const {product, onAdd} = props;
    const { products} = dataa;
    return (
        <>
           
            {/* <div>
                {products.map((product) => {
                    <Product key={product.id} product={product}></Product>
                })}
            </div> */}
          
            <div className="d-flex-4">
                   {products.map((item) => {
                  <Foods key={item.id} it={item} onAdd={onAdd}></Foods>

              } )}
            <Product product={product} onAdd={onAdd}></Product>
            </div>
        

        </>
    )
}
